                'description' => '{"en":"Bimasakti Academy is an educational institution committed to excellence in teaching and learning. With a focus on holistic development, the academy offers a wide range of programs designed to nurture students\' intellectual, emotional, and social growth. Through innovative teaching methods and a supportive learning environment, Bimasakti Academy aims to empower students to achieve their full potential and become responsible global citizens. The academy\'s curriculum emphasizes academic rigor, critical thinking, and practical skills development, preparing students for success in higher education and beyond.","hi":"\\u092c\\u093f\\u092e\\u093e\\u0938\\u0915\\u094d\\u0924\\u093f \\u090f\\u0915\\u0947\\u0921\\u092e\\u0940 \\u090f\\u0915 \\u0936\\u0948\\u0915\\u094d\\u0937\\u093f\\u0915 \\u0938\\u0902\\u0938\\u094d\\u0925\\u093e\\u0928 \\u0939\\u0948 \\u091c\\u094b \\u0936\\u093f\\u0915\\u094d\\u0937\\u093e \\u0914\\u0930 \\u0938\\u0940\\u0916\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u0909\\u0924\\u094d\\u0915\\u0943\\u0937\\u094d\\u091f\\u0924\\u093e \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092a\\u094d\\u0930\\u0924\\u093f\\u092c\\u0926\\u094d\\u0927 \\u0939\\u0948\\u0964 \\u092a\\u0942\\u0930\\u094d\\u0923\\u0924\\u093e \\u0915\\u094b \\u092e\\u0941\\u0916\\u094d\\u092f\\u0924: \\u0935\\u093f\\u0915\\u093e\\u0938 \\u092a\\u0930 \\u0927\\u094d\\u092f\\u093e\\u0928 \\u0915\\u0947\\u0902\\u0926\\u094d\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0941\\u090f, \\u090f\\u0915\\u0947\\u0921\\u092e\\u0940 \\u091b\\u093e\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u0947 \\u092c\\u094c\\u0926\\u094d\\u0927\\u093f\\u0915, \\u092d\\u093e\\u0935\\u0928\\u093e\\u0924\\u094d\\u092e\\u0915, \\u0914\\u0930 \\u0938\\u093e\\u092e\\u093e\\u091c\\u093f\\u0915 \\u0935\\u093f\\u0915\\u093e\\u0938 \\u0915\\u094b \\u092a\\u094b\\u0937\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u093f\\u092d\\u093f\