                'description' => '{"en":"Accounting is the process of recording, summarizing, analyzing, and reporting financial transactions of a business or organization. It involves the systematic recording of financial data, such as income, expenses, assets, and liabilities, to provide stakeholders with accurate and relevant financial information. Accounting plays a crucial role in decision-making, financial planning, and performance evaluation.","hi":"\\u0921\\u0947\\u0935\\u0911\\u092a\\u094d\\u0938 \\u0905\\u092d\\u094d\\u092f\\u093e\\u0938 \\u090f\\u0915 \\u0938\\u0902\\u092f\\u094b\\u091c\\u0928\\u093e \\u092e\\u0947\\u0902 \\u0938\\u092e\\u093e\\u0935\\u0947\\u0936 \\u0939\\u0948\\u0902 \\u091c\\u094b \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u0935\\u093f\\u0915\\u093e\\u0938 \\u0914\\u0930 \\u0938\\u0902\\u091a\\u093e\\u0932\\u0928 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u0930\\u094d\\u0935\\u094b\\u0924\\u094d\\u0924\\u092e \\u092a\\u094d\\u0930\\u0925\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0938\\u092e\\u0930\\u094d\\u0925\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u0907\\u0938\\u0915\\u093e \\u092e\\u0941\\u0916\\u094d\\u092f \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f \\u0938\\u0902\\u0917\\u0920\\u0928 \\u0915\\u0940 \\u0915\\u093e\\u0930\\u094d\\u092f\\u0915\\u094d\\u0937\\u092e\\u0924\\u093e, \\u0917\\u0941\\u0923\\u0935\\u0924\\u094d\\u0924\\u093e, \\u0914\\u0930 \\u0917\\u094d\\u0930\\u093e\\u0939\\u0915 \\u0938\\u0902\\u0924\\u0941\\u0937\\u094d\\u091f\\u093f \\u0915\\u094b \\u092c\\u0922\\u093c\\u093e\\u0928\\u093e \\u0939\\u094b\\u0924\\u093e \\u0939\\u0948\\u0964","ar":"\\u0627\\u0644\\u062a\\u0639\\u0644\\u0645 \\u0627\\u0644\\u0622\\u0644\\u064a \\u0647\\u0648 \\u0641\\u0631\\u0639 \\u0645\\u0646 \\u0639\\u0644\\u0648\\u0645 \\u0627\\u0644\\u062d\\u0627\\u0633\\u0648\\u0628 \\u064a\\u064f\\u0645\\u0643\\u0651\\u0646 \\u0623\\u0646\\u0638\\u0645\\u0629 \\u0627\\u