                'description' => '{"en":"English is a language that is widely spoken and understood across the globe. It is considered the international language of communication, commerce, and diplomacy. Studying English involves learning grammar, vocabulary, reading, writing, listening, and speaking skills. It allows individuals to communicate effectively, express ideas, and engage with literature and various forms of media. Proficiency in English is essential for academic, professional, and personal growth.","hi":"\\u0905\\u0902\\u0917\\u094d\\u0930\\u0947\\u091c\\u0940 \\u090f\\u0915 \\u092d\\u093e\\u0937\\u093e \\u0939\\u0948 \\u091c\\u094b \\u0935\\u093f\\u0936\\u094d\\u0935 \\u092d\\u0930 \\u092e\\u0947\\u0902 \\u0935\\u094d\\u092f\\u093e\\u092a\\u0915 \\u0930\\u0942\\u092a \\u0938\\u0947 \\u092c\\u094b\\u0932\\u0940 \\u0914\\u0930 \\u0938\\u092e\\u091d\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0938\\u0902\\u091a\\u093e\\u0930, \\u0935\\u093e\\u0923\\u093f\\u091c\\u094d\\u092f, \\u0914\\u0930 \\u0915\\u0942\\u091f\\u0928\\u0940\\u0924\\u093f \\u0915\\u0940 \\u0905\\u0902\\u0924\\u0930\\u094d\\u0930\\u093e\\u0937\\u094d\\u091f\\u094d\\u0930\\u0940\\u092f \\u092d\\u093e\\u0937\\u093e \\u092e\\u093e\\u0928\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u0905\\u0902\\u0917\\u094d\\u0930\\u0947\\u091c\\u0940 \\u0915\\u0940 \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0938\\u0947 \\u0935\\u094d\\u092f\\u093e\\u0915\\u0930\\u0923, \\u0936\\u092c\\u094d\\u0926\\u093e\\u0935\\u0932\\u0940, \\u092a\\u0922\\u093c\\u093e\\u0908, \\u0932\\u0947\\u0916\\u0928, \\u0938\\u0941\\u0928\\u0928\\u0947, \\u0914\\u0930 \\u092c\\u094b\\u0932\\u0928\\u0947 \\u0915\\u094c\\u0936\\u0932 \\u0915\\u094b \\u0938\\u0940\\u0916\\u093e \\u091c\\u093e\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0915\\u093e\\u0930\\u093e\\u0924\\u094d\\u092e\\u