                'description' => '{"en":"Mathematics is the study of numbers, quantities, shapes, and patterns. It encompasses various branches such as arithmetic, algebra, geometry, calculus, and statistics. Mathematics is essential in understanding the natural world, solving problems, and making logical decisions. It is used in various fields including science, engineering, economics, and finance.","hi":"\\u0917\\u0923\\u093f\\u0924 \\u0938\\u0902\\u0916\\u094d\\u092f\\u093e\\u0913\\u0902, \\u092e\\u093e\\u0924\\u094d\\u0930\\u093e\\u0913\\u0902, \\u0906\\u0915\\u093e\\u0930\\u094b\\u0902, \\u0914\\u0930 \\u092a\\u0948\\u091f\\u0930\\u094d\\u0928 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0905\\u0902\\u0915\\u0917\\u0923\\u093f\\u0924, \\u092c\\u0940\\u091c\\u0917\\u0923\\u093f\\u0924, \\u0930\\u0947\\u0916\\u093e\\u0917\\u0923\\u093f\\u0924, \\u0915\\u0932\\u0928, \\u0914\\u0930 \\u0938\\u093e\\u0902\\u0916\\u094d\\u092f\\u093f\\u0915\\u0940 \\u091c\\u0948\\u0938\\u0940 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0936\\u093e\\u0916\\u093e\\u090f\\u0902 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964 \\u0917\\u0923\\u093f\\u0924 \\u092a\\u094d\\u0930\\u093e\\u0915\\u0943\\u0924\\u093f\\u0915 \\u0926\\u0941\\u0928\\u093f\\u092f\\u093e \\u0915\\u094b \\u0938\\u092e\\u091d\\u0928\\u0947, \\u0938\\u092e\\u0938\\u094d\\u092f\\u093e\\u0913\\u0902 \\u0915\\u094b \\u0939\\u0932 \\u0915\\u0930\\u0928\\u0947, \\u0914\\u0930 \\u0924\\u093e\\u0930\\u094d\\u0915\\u093f\\u0915 \\u0928\\u093f\\u0930\\u094d\\u0923\\u092f \\u0932\\u0947\\u0928\\u0947 \\u092e\\u0947\\u0902 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928, \\u0907\\u0902\\u091c\\u0940\\u0928\\u093f\\u092f\\u0930\\u093f\\u0902\\u0917, \\u0905\\u0930\\u094d\\u0925\\u0936\\u093e\\u0938\\u094d\\u0924\\u094d\\u093