                'description' => '{"en":"Physics is the study of matter, energy, motion, and the fundamental forces of nature. It encompasses various branches such as classical mechanics, electromagnetism, thermodynamics, optics, and quantum mechanics. Physics seeks to understand the fundamental principles governing the universe and to describe and predict the behavior of objects and phenomena at different scales. It is essential in advancing technology, engineering, and our understanding of the natural world.","hi":"\\u092d\\u094c\\u0924\\u093f\\u0915 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u092a\\u0926\\u093e\\u0930\\u094d\\u0925, \\u090a\\u0930\\u094d\\u091c\\u093e, \\u0917\\u0924\\u093f, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0915\\u0943\\u0924\\u093f \\u0915\\u0940 \\u092e\\u094c\\u0932\\u093f\\u0915 \\u0936\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u093e\\u091a\\u0940\\u0928 \\u092f\\u093e\\u0902\\u0924\\u094d\\u0930\\u093f\\u0915\\u0940, \\u0935\\u093f\\u0926\\u094d\\u092f\\u0941\\u0924\\u091a\\u0941\\u0902\\u092c\\u0915\\u0924\\u094d\\u0935, \\u090a\\u0937\\u094d\\u092e\\u093e \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928, \\u092a\\u094d\\u0930\\u0915\\u093e\\u0936\\u093f\\u0915\\u0940, \\u0914\\u0930 \\u0915\\u094d\\u0935\\u093e\\u0902\\u091f\\u092e \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u091c\\u0948\\u0938\\u0940 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0936\\u093e\\u0916\\u093e\\u090f\\u0902 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964 \\u092d\\u094c\\u0924\\u093f\\u0915 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u092c\\u094d\\u0930\\u0939\\u094d\\u092e\\u093e\\u0902\\u0921 \\u0915\\u0947 \\u092e\\u094c\\u0932\\u093f\\u0915 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u094b\\u0902 \\u0915\\u094b \\u0938\\u092e\\u091d\\u0928\\u0947