                'description' => '{"en":"Chemistry is the study of matter, its properties, composition, structure, and the changes it undergoes during chemical reactions. It encompasses various branches such as organic chemistry, inorganic chemistry, physical chemistry, analytical chemistry, and biochemistry. Chemistry plays a crucial role in understanding the composition of substances, developing new materials, medicines, and technologies, and addressing environmental issues. It is essential in various fields including medicine, pharmacy, agriculture, and industry.","hi":"\\u0930\\u0938\\u093e\\u092f\\u0928 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u092a\\u0926\\u093e\\u0930\\u094d\\u0925, \\u0909\\u0928\\u0915\\u0940 \\u0917\\u0941\\u0923, \\u0938\\u0902\\u0930\\u091a\\u0928\\u093e, \\u0914\\u0930 \\u0930\\u093e\\u0938\\u093e\\u092f\\u0928\\u093f\\u0915 \\u092a\\u094d\\u0930\\u0924\\u093f\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u0926\\u094c\\u0930\\u093e\\u0928 \\u0939\\u094b\\u0928\\u0947 \\u0935\\u093e\\u0932\\u0947 \\u092a\\u0930\\u093f\\u0935\\u0930\\u094d\\u0924\\u0928 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u091c\\u0948\\u0935\\u093f\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928, \\u0905\\u091c\\u0948\\u0935\\u093f\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928, \\u092d\\u094c\\u0924\\u093f\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928, \\u0935\\u093f\\u0936\\u094d\\u0932\\u0947\\u0937\\u0923\\u093e\\u0924\\u094d\\u092e\\u0915 \\u0930\\u0938\\u093e\\u092f\\u0928, \\u0914\\u0930 \\u091c\\u0948\\u0935 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u091c\\u0948\\u0938\\u0940 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0936\\u093e\\u0916\\u093e\\u090f\\u0902 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964 \\u0930\\u0938\\u093e\\u092f\\u0928 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0938\\u092e\\u091d\\u0928\\u0947 \\u092e\\u0